import React, { Component } from 'react';



class List extends React.Component {

  constructor(props) {
    super(props)

  }



  inputkeyword(name){
    fetch(`http://localhost:3001/players/list/${name}`)
      .then(response => response.json())
      .then(responseJson => {
        this.setState({ player: responseJson.data });
      });
  };

  render(){
    return <div
    className="container">
  <input type="text"
  id="rechercher"
  className="input"
  placeholder="Search..." />
  <a onClick={() => this.inputkeyword(document.getElementById("rechercher").value)} className="bouton1">Search</a>
</div>
  }
}



export default List;
